import './App.css';
import React, { Component } from 'react';
import Ingredient from './components/ingredient'
import FreezeBee from './components/freezebee';
import { BrowserRouter as Router, Switch, Route, Link, NavLink } from 'react-router-dom';
import Fabrication from './components/fabrication';
import { Navbar, NavbarBrand } from 'react-bootstrap';

class App extends Component {
  render() {
    return (
      <Router>
        <Navbar bg="dark" variant="dark">
          <Container>
            <NavbarBrand>Bienvenu sur KillerBee</NavbarBrand>
            <NavLink to={'/freezebee'} className="nav-link">
              FreezeBee
            </NavLink>
            <NavLink to={'/fabrication'} className="nav-link">Procédé de fabrication
            </NavLink>
          </Container>
        </Navbar>
          <nav className="navbar navbar-expand-lg navbar-light bg-light">
            <ul className="navbar-nav mr-auto">
              <li></li>
              <li><Link to={'/freezebee'} className="nav-link">Freezebee</Link></li>
              <li><Link to={'/fabrication'} className="nav-link">Procédé de fabrication</Link></li>
            </ul>
          </nav>
          <hr />
          <Switch>
            <Route exact path='/ingredient' component={Ingredient} />
            <Route path='/freezebee' component={FreezeBee} />
            <Route path='/fabrication' component={Fabrication} />

          </Switch>
      </Router>
    );
  }
}

export default App;
